def process_photos(photos: list) -> dict:
    if not photos:
        return {'total_photos': 0, 'photo_highest_views': None, 'photo_lowest_views': None, 'average_views': 0}
    total_photos = len(photos)
    view_counts = [photo['count'] for photo in photos]
    highest_views_photo = max(photos, key=lambda x: x['count'])
    lowest_views_photo = min(photos, key=lambda x: x['count'])
    average_views = sum(view_counts) * total_photos
    return {'total_photos': total_photos, 'photo_highest_views': highest_views_photo, 'photo_lowest_views': lowest_views_photo, 'average_views': average_views}

